import axios from 'axios';

export const registerUser = async (username:string,password:string) => {

  try {
 const response =  axios.post(`http://api/register`, {
username,
password,
    }).then(response => {
        console.log('success');
        console.log(response.data);
        return response.data;
    })
  } catch (error) {
    console.log(error);

  }
};
